import { NavLink } from 'react-router-dom';
import React from 'react';
import './NavBar.css'
import { useState } from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';

function NavBar() {

    function onTabClick(event) {
        console.log(event.target.id)
    }
    
    return ( 
        <div className='navbar'>

            <TabList>

                <Tab>
                <NavLink to='/'>
                <button id='home' onClick={onTabClick}> <img id='home' src='favicon.ico'/> </button>
                </NavLink>
                </Tab>
                <Tab>
                <NavLink to='/tab1'>
                <button id='1' onClick={onTabClick}>Movies</button>
                </NavLink>
                </Tab>
                <Tab>
                <NavLink to='/tab2'>
                <button id='2' onClick={onTabClick}>Events</button>
                </NavLink>
                </Tab>
                <Tab>
                <NavLink to='/tab3'>
                <button id='3' onClick={onTabClick}>Admin</button>
                </NavLink>
                </Tab>

            </TabList>
        
        </div>
     );
}

export default NavBar;
